        self.searchText = newQuery;

        if(!minLengthMet(newQuery)) {
            setLoading(false);
            clearMatches();
        }else{
            handleQuery();
            //$scope.$eval($attrs.autocompleteQuery);
        }
        //console.log(newQuery);
