                    "shortName": "Meiji 10\" Bread Knife",
                    "attributes": {},
                    "serialized": false,
                    "description": "Combine Japanese aesthetics, the ease and familiarity of Western-style blades and legendary bladesmith Bob Kramer, and the result is the revolutionary Meiji collection. A true fusion of Eastern and Western knifemaking philosophies, Bob Kramer Meiji offers the impeccable style of Japanese knives paired with the performance and accessibility of Western blade shapes optimized for kitchen use. Bob Kramer Meiji is only available at Sur La Table. \n\nPerfect for slicing everything from crusty baguettes to moist, airy brioche, this bread features an extra-long, serrated blade that wont crush delicate loaves. Razor-sharp right out of the box, its a versatile and eye-catching addition to any kitchen.",
